import React from "react";


const Songlibrary =({song}) =>{
	
	
	
	return(
		<div class="libray">
		<h4>Image</h4>
		<h4>{song.Music_name}</h4>
		<h4>{song.Artist_name}</h4>
		
		
		</div>
		)
		
		
	
}
export default Songlibrary
